    [],nt"revision_timestamp": "2016-05-25T00:43:34.588482",nt"name": "compliance-and-enforcement-actions-cea",nt"isopen":
    true,nt"url": null,nt"notes": "Compliance and Enforcement Actions application
    provides process assistance / improvements for conducting investigation and enforcement
    activities. The Compliance and Enforcement Actions application is one of four sub-functions
    under Function 9 - Investigation and Enforcement. The FAA conducts an investigation
    to determine if enforcement actions need to be taken upon receipt of information
    indicating a possible rule or policy violation. The objective of the investigation
    is to collect enough information to determine whether or not an actual rules violation
    has occurred, and if so, what enforcement action needs to be taken to correct the
    violation. The supporting information collected may be in the form of interviews,
    photographs, charts, maps, diagrams, reports, records, physical evidence, and/or
    any other material that is legally obtainable. All of the evidence and findings
    are documented in the Enforcement Investigation Report.",nt"license_title":
